function ExpenseDate(props){
    return(
        <div className='expense-date'>
        <div className='month'>{props.date.toLocaleDateString('en-US' , {month : 'long'})}</div>
        <div className='day'>{props.date.toLocaleDateString('en-US' , {day : '2-digit'})}</div>
        <div className='year'>{props.date.getFullYear()}</div>
        </div>
    );
}

export default ExpenseDate;
